(()=>{"use strict";function e(e,n){for(var t="<table>",r=0,d=0;d<e;d++){t+="<tr>";for(var i=0;i<n;i++)t=t+"<th>"+(r+=1)+"</th>";t+="</tr>"}return t+"</table>"}window.onload=function(){document.getElementById("demo").innerHTML="Here is an active JS running...",document.getElementById("grid1").innerHTML=e(10,10),document.getElementById("grid2").innerHTML=e(10,10),document.getElementById("grid1a").innerHTML=e(10,10),document.getElementById("grid2a").innerHTML=e(10,10)}})();